methods.advance:
Advance the current iterator position until currentRangeStart() and currentRangeEnd()
 are both greater than or equal to  v . This may or may not move the iterator to the next range:
 if  v  is inside the current range (but to the right of currentRangeStart(),
 this will simply advance currentRangeStart(). Returns true if the operation was successful.
 Otherwise, returns false. In this case the iteration is over and the iterator
 is exhausted (calls to hasNext() will return false, any other operation is undefined).


 Although calls to advance() may be interleaved with calls to hasNext()/next() if necessary,
 this is not the common case, as they are separate protocols having little to do with each other.
 In particular, when iterating with advance(), you do not use next() to bring the next range into view,
 even at the start of the iteration. Many common usages only involve calls to advance().


 Example:


 RangeIterator it = index.getRangeIterator();
 if (!it.advance(100)) {
     return;  // iteration done  no ranges at 100 or greater
 }
 assert(it.currentRangeStart() >= 100 && it.currentRangeEnd() >= 100);
  // do something with range
 if (!it.advance(500)) {
    return;  // iteration done  no ranges at 500 or greater
 }
 assert(it.currentRangeStart() >= 500 && it.currentRangeEnd() >= 500);
 // do something with range


:param v: (long) - a value to search forward from the current iterator position
:return: (boolean) false if iteration is exhausted, otherwise true.
